import React from 'react'
import Button from "react-bootstrap/Button";
import glyphicon from '../images/search.png';

const Login = () => {
  let st = {
    width: '30%',
    marginBottom: '4%'
  };

  let st1 = {
    width: '45%',
    marginTop: '10%',
    marginLeft: '40%',
    padding: '0',
    fontSize: '150%',
  };
  
  return (
    <>
    <form action="" className='login'>
        <input type="text" name="user" id="user" placeholder='Username/Email' />
        <br/>
        <input type="password" name="pass" id="pass" placeholder='Password' />
        <br/>
        <Button type="button" class="btn btn-default btn-sm" style={st1}>
          Find <img src={glyphicon} alt="search glyphicon" style={st} />
        </Button>
    </form>
    </>
  )
}

export default Login
